import Layout from "../components/MyLayout.js";


const Index = () => {

    return (
      <Layout>

        <div className="home">
        <img class="home__img" src="/static/images/gallery/croatia/4.jpg" alt=""/>
        <div class="overview__container"><div class="overview__img" style="background-image: url(&quot;static/images/sites/riverisland.png&quot;);"> </div><div class="overview__content"><h2 class="overview__title title--md">River Island</h2><p href="Working on the front end development and maintenance of www.riverisland.com. Working with the team to develop the website in line with business prioritisation. Creating a pixel perfect experiences across browsers and devices." class="overview__text">Working on the front end development and maintenance of www.riverisland.com. Working with the team to develop the website in line with business prioritisation. Creating a pixel perfect experiences across browsers and devices.</p><h2 class="overview__title--md title--md">code used</h2><ul class="overview__code"><li class="overview__code__item">- html</li><li class="overview__code__item">- sass</li><li class="overview__code__item">- JavaScript</li><li class="overview__code__item">- jQuery</li></ul><h2 class="overview__title--md title--md">links</h2><div class="overview__links"><a href="//www.riverisland.com" target="_blank" class="overview__links__link">riverisland</a></div></div></div>
              </div>
      </Layout>
    );

}

export default Index;
